import React from 'react';
import ProgressBar from '../ProgressBar';
import styles from './Skills.module.scss';

const { container, progressBars, description } = styles;

const Skills = () => {
  return (
    <div className={container}>
      <div className={progressBars}>
        <ProgressBar title="JavaScript" width={95} />
        <ProgressBar title="Typescript" width={80} />
        <ProgressBar title="HTML" width={95} />
        <ProgressBar title="CSS, SCSS, LESS, CSS Modul" width={95} />
        <ProgressBar title="React.js with Redux" width={95} />
        <ProgressBar title="Next.js" width={90} />
        <ProgressBar title="Google Analytics and Tag Manager" width={85} />
        <ProgressBar title="React Native" width={75} />
        <ProgressBar title="Node.JS and Express" width={75} />
        <ProgressBar title="Java" width={75} />
        <ProgressBar title="Python" width={60} />
        <ProgressBar title="C/C++" width={50} />
      </div>
      <div className={description}>Some text</div>
    </div>
  );
};

export default Skills;
